import { Provider } from "react-redux";

export const App = ( ) => {
    return (
        <Provider store={store}>
            <div className="app">
            <AppHeader/>
            <div className="app-body">
                <Sidebar/>
                <Body/>
            </div>
        </div>
        </Provider>
    );
}
